
CREATE DATABASE IF NOT EXISTS caddm_db;
USE caddm_db;

CREATE TABLE IF NOT EXISTS employee_table (
    id INT PRIMARY KEY,
    first_name VARCHAR(50),
    last_name VARCHAR(50),
    ssn VARCHAR(20),
    race VARCHAR(100),
    gender VARCHAR(20),
    email VARCHAR(100),
    phone VARCHAR(20),
    department VARCHAR(100),
    job_title VARCHAR(100),
    salary INT
);

